import React from 'react';
import logo from './logo.svg';
import './App.css';
import Page from './Figures/states.html';
import Plot from 'react-plotly.js';
var htmlDoc = {__html: Page}
var bgColors = { "Default": "#81b71a",
                    "Blue": "#00B1E1",
                    "Cyan": "#37BC9B",
                    "Green": "#8CC152",
                    "Red": "#E9573F",
                    "Yellow": "#F6BB42",
};
function App() {
  return (
    <div className="App">
      <div dangerouslySetInnerHTML={renderHTML()} style={{backgroundColor: bgColors.Yellow}} />
    </div>
  );
}
function renderHTML() {
  console.log('Rendering HTML:')
  console.log(htmlDoc)
  // return {__html: "<h3>'test 3'</h3>"}
  return htmlDoc
}
function renderMap() {
  return (
      <Plot
        data={[
          {
            x: [1, 2, 3],
            y: [2, 6, 3],
            type: 'scatter',
            mode: 'lines+markers',
            marker: {color: 'red'},
          },
          {type: 'bar', x: [1, 2, 3], y: [2, 5, 3]},
        ]}
        layout={{width: 320, height: 240, title: 'A Fancy Plot'}}
      />
    )
}
export default App;
